import React, { Component } from 'react'
import { Input } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { NavLink,Switch,Route } from 'react-router-dom'
import ShowList from './ShowList'
import Showpic from './Showpic'
import './index.css'

export default class Record extends Component {
    render() {
        return (
                <div className="showlink">
                    <NavLink to="/List/Record/ShowList">列表显示</NavLink>
                    <NavLink to="/List/Record/Showpic">图表显示</NavLink>
                    <Search placeholder="input search text" onSearch={onSearch} enterButton />
                    <NavLink to="/List/Add">新增失物</NavLink>
                    <Switch>
                        <Route path="/List/Record/ShowList" component={ShowList}></Route>
                        <Route path="/List/Record/Showpic" component={Showpic}></Route>
                    </Switch>
                    
                </div>        
        )
    }
}
